QPixmap Data2Pixmap( const char * data[] )
{
  QString str;
  int count = 0;
  while( data[count] != 0 )
  {
    str += QString(data[count]);
    count++;
  }
  int size = str.length()/2;
#if QT_VERSION >= 0x040000
  QByteArray ba(size, ' ');
#else
  QByteArray ba(size);
#endif // QT_VERSION >= 0x040000
  for(int i = 0; i < size; i++)
  {
    QString s (str.mid(i * 2, 2 ));
    bool ok;
    ba[i] = s.toInt( &ok, 16 );
  }
  QPixmap pm;
  pm.loadFromData( qUncompress(ba), "PNG" ); 
  return pm;
}

